import React from "react";
import Gym from "@cvccorp-components/icons/dist/Gym";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { Wifi } from "@material-ui/icons";
import { storiesOf } from "@storybook/react";
import themes from "../../../Theme/themes";
import { BrandType } from "../../../types/brand";
import ResultItemHotel from "../ResultItem";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type HotelStoryProps = {
    mode: string,
    brand: BrandType,
    title: string,
    subtitle: string,
    stars: number,
    totalPrice: string,
    taxesIncluded: boolean,
    parcel: string,
    lastItem: string, 
    meal: string,
    rate: string,
    totalAvaliations: string,
    discount: string,
    partialPrice: string,
    oldPartialPrice: string,
    totalPeople: string,
    totalDays: string
}

const HotelStory = ({
    mode, 
    brand, 
    title, 
    subtitle, 
    stars, 
    totalPrice,
    taxesIncluded, 
    parcel,
    lastItem, 
    meal,
    rate,
    totalAvaliations,
    discount,
    partialPrice,
    oldPartialPrice,
    totalPeople,
    totalDays
}: HotelStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="Hotel">
                <Typography variant="h3">Hotel</Typography>
                <br />
                <Divider />
                <br />
                <ResultItemHotel
                    onClick={() => { } }
                    type="result"
                    product="hotel"
                    onFav={() => { } }
                    title={title}
                    subtitle={subtitle}
                    stars={stars}
                    totalPrice={totalPrice}
                    taxesIncluded={taxesIncluded}
                    parcel={parcel}
                    imgs={["http://lorempixel.com/output/city-q-c-298-285-3.jpg", "http://lorempixel.com/output/city-q-c-298-285-3.jpg"]}
                    amenities={[<Wifi key="Wifi" />, <Gym key="Gym" />]}
                    hotelCoordinates={{ latitude: 41.390847, longitude: 2.16902 }}
                    isAvuxi="true"
                    toggleSeeModal={() => { } } 
                    isActive
                    lastItem={lastItem}
                    className={{}} 
                    meal={meal}
                    rate={rate}
                    totalAvaliations={totalAvaliations}
                    discount={discount}
                    stops
                    departure="departure"
                    arrival={undefined}
                    hasLuggage
                    partialPrice={partialPrice}
                    oldPartialPrice={oldPartialPrice}
                    totalPeople={totalPeople}
                    totalDays={totalDays}
                    id="1"        
                />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
        title: "Item 2",
        subtitle: "Subtitle 2",
        stars: 3,
        totalPrice: "100",
        taxesIncluded: true,
        parcel: "12",
        lastItem: "3", 
        meal: "meal",
        rate: "10",
        totalAvaliations: "9",
        discount: "50",
        partialPrice: "40",
        oldPartialPrice: "180",
        totalPeople: "2",
        totalDays: "9",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        title: { type: "string" },
        subtitle: { type: "string" },
        stars: { type: "number" },
        totalPrice: { type: "string" },
        taxesIncluded: { type: "boolean" },
        parcel: { type: "string" },
        lastItem: { type: "string" },
        meal: { type: "string" },
        rate: { type: "string" },
        totalAvaliations: { type: "string" },
        discount: { type: "string" },
        partialPrice: { type: "string" },
        oldPartialPrice: { type: "string" },
        totalPeople: { type: "string" },
        totalDays: { type: "string" },
    }
}

